import React from 'react';
import './App.css';
import Footer from './components/footer/Footer';
import Header from './components/header/Header';
import Operators from './components/operators/Operators';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import CheckList from './components/Check/CheckList';

function App(props) {
  let operators = props.operators.map(operators);
    return (
      <BrowserRouter>
        <div className="app__wrapper">
          <Header />
          <Route
            exact
            path="/main"
            render={() => <Operators content={operators} />}
          />
          <Switch>
            <Route
              exact
              path={() => "/checklist/" + operators.id[0]}
              render={() => <CheckList  />}
            />
            <Route
              exact
              path={() => "/checklist/" + operators.id[1]}
              render={() => <CheckList content={operators.name[1]} />}
            />
            <Route
              exact
              path={() => "/checklist/" + operators.id[2]}
              render={() => <CheckList content={operators.name[2]} />}
            />
          </Switch>
          <Footer />
        </div>
      </BrowserRouter>
    );
}

export default App;
